import Product from "./product";

const Catalog = () =>{
    return(
        <div className="catalog">
            <h2>This is our Amazing Catalog!!</h2>
            <h3>We have #products products!</h3>
            <Product title= "Product" price="150.00">Basketball</Product>
            <Product title= "Test 2" price="15.00">Baseball</Product>
            <Product title= "Test 3" price="175.00">Softball</Product>
            <Product title= "Test 4" price="250.00">Tennis ball</Product>
            <Product title= "Test 5" price="350.00">Golf ball</Product>


            {/* display the products here */}
        </div>
    );
}

export default Catalog;
